const ExerciseList = (props) => {
    console.log("in exercise list");
    console.log(props);
    console.log(props.list);
    props.list.forEach((exercise) => {
        console.log(exercise);
    });
    return (
        props.list.forEach((exercise) => {
            console.log(exercise.name);
        })
    );
}

export default ExerciseList;
